import React, { useState } from 'react';
import axios from 'axios';
import { REGISTER_API_URL } from '../url';

const Register = () => {
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');

    const handleRegister = async () => {
        try {
            const response = await axios.post(REGISTER_API_URL, { username, password });
            if (response && response.data && response.data.token) {
                const token = response.data.token;
                // Save token to local storage or context for future API requests
                console.log('Registered and logged in successfully. Token:', token);
            } else {
                console.error('Invalid response format');
            }
        } catch (error) {
            console.error('Registration failed:', error.message);
        }
    };


    return (
        <div>
            <h2>Register</h2>
            <input type="text" placeholder="Username" value={username} onChange={(e) => setUsername(e.target.value)} />
            <input type="password" placeholder="Password" value={password} onChange={(e) => setPassword(e.target.value)} />
            <button onClick={handleRegister}>Register</button>
        </div>
    );
};

export default Register;
